import React from 'react';
import './Register.css';
// import { Form } from 'react-router-dom';

const Register = () => {
  return (
    <div id='register' className='register'>
      <div className='card'>
      <form>
        <div className='row'>
        <div className='col-4'>
        <label className='labelfull'>Full Name:&nbsp;
        <input type='text' className='fullname'></input>
        </label>
        <label className='labellast'>Last Name:&nbsp;
        <input type='text' className='lastname'></input>
        </label>
        </div>
        </div>
        <br />
        <div className='col-4'>
        <label className='labelemail'>Email:&nbsp;
        <input type="email" className='email' name="email"></input>
        </label>
        </div>
      </form>
      </div>
      </div>
  )
}

export default Register
